import React, { Component } from 'react'
import {Nav} from "react-bootstrap"

class Error extends Component {
    render() {
        return (

        <div className="mt-5 mark ">

            <p class="display-1 text-start">Sorry</p>
            <h1 class="display-2 text-start">We did not find what you were looking for</h1>
            <p class="display-3 text-start">You should check if the address you entered is correct</p>
            <p className="display-4 text-start">Try searching again or continue<Nav.Link href="/" className="my">To our home page</Nav.Link></p>                        
            
        </div>

        )
    }
}

export default Error
